import styled from "styled-components";

const Father = styled.div`
display : flex;
`;

const Btn = styled.button`
background-color :"tomato";
width: 100px;
height : 100px;
`;

const Circle = styled(Box)`
border-radius:50px ;
`;

function App() {
  return (
  
  <Father>
   <Circle bgColor="tomato"/>
   <Box bgColor="teal"/>
  </Father>
   );

}

export default App;
